import React, { createContext, useState, useEffect } from "react";
import styled from "styled-components";

const CategortPage = () => {
  const { category } = useParams();

  useEffect(() => {
    fetch(`/items/category/${category}`)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      })
      .catch((err) => {
        console.log("error");
      });
  }, []);
  return <>Hello category</>;
};

export default CategortPage;
